import React from 'react';
import styles from './Users.modules.css';
class Users extends React.Component {
  render() {
    return (
      <React.Fragment>
        <h1>Please Sign In</h1>
        <div className={styles.InputField}>
          <label>Username</label>
          <input type="text"/>
        </div>
      </React.Fragment>
    )
  }
}
export default Users
